import type {
  APIGatewayAuthorizerWithContextResult,
  APIGatewayAuthorizerResult,
  Handler,
  APIGatewayTokenAuthorizerEvent,
  APIGatewayRequestAuthorizerEvent,
} from 'aws-lambda';
import { DUser } from '@actually-colab/editor-types';

import { getUserFromBearerToken } from './token';
import { ShallotAWS } from 'shallot';

const generatePolicy = (
  principalId: string,
  methodArn: string,
  effect: 'Allow' | 'Deny',
  user?: DUser
): APIGatewayAuthorizerWithContextResult<DUser> | APIGatewayAuthorizerResult => {
  const res: APIGatewayAuthorizerResult = {
    principalId: principalId,
    policyDocument: {
      Version: '2012-10-17',
      Statement: [
        {
          Action: 'execute-api:Invoke',
          Effect: effect,
          Resource: methodArn,
        },
      ],
    },
  };

  if (user) {
    res.context = user;
  }

  return res;
};

const authorize = async (
  methodArn: string,
  token?: string
): Promise<APIGatewayAuthorizerWithContextResult<DUser> | APIGatewayAuthorizerResult> => {
  if (token != null) {
    try {
      const user = await getUserFromBearerToken(token);

      if (user !== null) {
        return generatePolicy(user.uid, methodArn, 'Allow', user);
      }
    } catch (error) {
      console.error(error);
    }
  }

  return generatePolicy('unknown', methodArn, 'Deny');
};

const _rest: Handler<
  APIGatewayTokenAuthorizerEvent,
  APIGatewayAuthorizerWithContextResult<DUser> | APIGatewayAuthorizerResult
> = async (event) => {
  // arn:aws:execute-api:region:account-id:api-id/stage-name/HTTP-VERB/resource-path-specifier
  const paths = event.methodArn.split('/');
  const apiMeta = paths[0].split(':');
  const accountId = apiMeta[4];
  const apiId = apiMeta[5];
  const stageName = paths[1];
  const wildcardMethodArn = `arn:aws:execute-api:*:${accountId}:${apiId}/${stageName}/*/*`;

  return authorize(wildcardMethodArn, event.authorizationToken);
};

export const rest = ShallotAWS(_rest);

const _socket: Handler<
  APIGatewayRequestAuthorizerEvent,
  APIGatewayAuthorizerWithContextResult<DUser> | APIGatewayAuthorizerResult
> = async (event) => {
  const token = event.queryStringParameters?.sessionToken ?? event.headers?.Authorization;

  return authorize(event.methodArn, token);
};

export const socket = ShallotAWS(_socket);

import { DUser, DActiveSession } from '@actually-colab/editor-types';

import createHttpError from 'http-errors';
import jwt from 'jsonwebtoken';

import { getUserById } from '../db/pgsql/models/User';
import { getActiveSessionById } from '../db/pgsql/models/ActiveSession';

interface TokenPayload {
  uid: DUser['uid'];
  tokenType: 'dev' | 'session' | 'google';
}

export const getDevToken = (uid: DUser['uid']): string => {
  return jwt.sign({ uid, tokenType: 'dev' } as TokenPayload, 'dev');
};

export const getProdToken = (uid: DUser['uid']): string => {
  if (process.env.PROD_AUTH_SECRET == null) {
    throw new Error('PROD_AUTH_SECRET env var not defined');
  }

  return jwt.sign(
    { uid, tokenType: 'session' } as TokenPayload,
    process.env.PROD_AUTH_SECRET
  );
};

export const decodeTokenPayload = (accessToken: string): TokenPayload => {
  return jwt.decode(accessToken) as TokenPayload;
};

export const getSessionToken = (bearerToken: string): string => {
  if (bearerToken.startsWith('Bearer')) {
    return bearerToken.substr(7);
  }

  throw new Error('Invalid token');
};

export const getUserFromBearerToken = async (
  bearerToken: string
): Promise<DUser | null> => {
  const sessionToken = getSessionToken(bearerToken);
  return getUserFromSessionToken(sessionToken);
};

export const getUserFromSessionToken = async (
  sessionToken: string
): Promise<DUser | null> => {
  const tokenPayload = decodeTokenPayload(sessionToken);

  switch (tokenPayload.tokenType) {
    case 'dev': {
      if (!process.env.IS_OFFLINE) {
        throw new createHttpError.Forbidden('Cannot use dev token in prod');
      }
      break;
    }
    case 'session': {
      if (process.env.PROD_AUTH_SECRET == null) {
        throw new Error('PROD_AUTH_SECRET env var not defined');
      }

      if (jwt.verify(sessionToken, process.env.PROD_AUTH_SECRET) == null) {
        throw new createHttpError.Unauthorized('Invalid token');
      }

      break;
    }
    default: {
      throw new createHttpError.BadRequest('Unknown token type');
    }
  }

  return getUserById(tokenPayload.uid);
};

export const getUserFromConnectionId = async (
  connectionId: DActiveSession['connectionId']
): Promise<DUser | null> => {
  const session = await getActiveSessionById(connectionId);
  if (session == null) {
    return null;
  }

  return getUserById(session.uid);
};

